import React from 'react'
import { theUrl } from 'selfConfig'
import { connect } from 'react-redux'

const getAdminList = theUrl + '/getAdminList'

const getList = (dispatch) => {

    fetch(getAdminList)
    .then(res => { return res.json() })
    .then(res => {
        console.log(res)
        dispatch({
            type: 'INIT',
            res
        })
    })
}

const List = ({ dispatch }) => {
    getList(dispatch);

    return(
        <h1>This is list component</h1>
    )
}



export default connect()(List);
